	/*1、热力图*/
	function makeHeatmap(divId, heatmapInfoArray, heatmapRule, styleData, isEdit) {
	    /*数组长度*/
	    var arrayLength = heatmapInfoArray.length;
	    /*热力图边长*/
	    var heatMapLengt = Math.ceil(Math.sqrt(arrayLength));
	    /*仪表热力图数组序号index*/
	    var infoArrayIndex;
	    /*X轴与Y轴的数据*/
	    var heatmapData = [];
	    var heatmapSeriesData = [];
	    /*Y轴循环*/
	    for (var j = 0; j < heatMapLengt; j++) {
	        /*X轴与Y轴的数值*/
	        heatmapData.push(j);
	        /*X轴循环*/
	        for (var k = 0; k < heatMapLengt; k++) {
	            var heatmapSingleData = [];
	            infoArrayIndex = j * heatMapLengt + k + 1;
	            if (infoArrayIndex <= arrayLength) {
	                heatmapSingleData.push(k);
	                heatmapSingleData.push(j);
	                heatmapSingleData.push(heatmapInfoArray[infoArrayIndex - 1].value);
	            } else {
	                heatmapSingleData.push(k);
	                heatmapSingleData.push(j);
	                heatmapSingleData.push('-');
	            }
	            heatmapSeriesData.push(heatmapSingleData);
	        }
	    };

	    var myCharts;
	    if (isEdit === undefined) {
	        myCharts = echarts.init(document.getElementById(divId), 'castheme');
	    } else {
	        //获取父页面中仪表所在的dom节点
	        myCharts = echarts.init(window.parent.document.getElementById(divId), 'castheme');
	    }

	    var option = {
	        tooltip: {
	            formatter: function formatter(params) {
	                /*params.value中，0对应的是X轴，1对应的是Y轴，其中X周与Y轴都是从0开始的*/
	                var index = params.value[1] * heatMapLengt + params.value[0];
	                var toolTipInfo = "<p class='heartmap-hostip'><span>hostIP:</span>" + heatmapInfoArray[index].hostIP + "</p><p class='heartmap-hostname'><span>hostName:</span>" + heatmapInfoArray[index].hostName + "</p><p class='heartmap-value'><span>value:</span>" + heatmapInfoArray[index].value + "</p>";
	                return toolTipInfo;
	            }
	        },
	        animation: false,
	        grid: {
	            height: '70%',
	            y: '15%'
	        },
	        legend: {
	            textStyle: {
	                color: '#eee',
	                fontSize: 12
	            }

	        },
	        backgroundColor: styleData.backgroundColor,
	        xAxis: {
	            type: 'category',
	            axisLabel: {
	                show: false
	            },
	            data: heatmapData,
	            splitArea: {
	                show: true
	            }
	        },
	        yAxis: {
	            type: 'category',
	            data: heatmapData,
	            axisLabel: {
	                show: false
	            },
	            splitArea: {
	                show: true
	            }
	        },
	        visualMap: {
	            min: 0,
	            max: 100,
	            calculable: true,
	            orient: 'horizontal',
	            left: 'center',
	            top: 'top',
	            type: 'piecewise',
	            pieces: function () {
	                var ruleArray = [];
	                for (var i = 0; i < heatmapRule.colorArray.length; i++) {
	                    var piecesObject = {};
	                    piecesObject.gte = heatmapRule.levelArray[i];
	                    piecesObject.lt = heatmapRule.levelArray[i + 1];
	                    piecesObject.color = heatmapRule.colorArray[i];
	                    ruleArray.push(piecesObject);
	                };
	                return ruleArray;
	            }(),
	            textStyle: {
	                color: '#fff'
	            }
	        },
	        series: [{
	            name: 'disk使用率',
	            type: 'heatmap',
	            data: heatmapSeriesData,
	            label: {
	                normal: {
	                    show: styleData.otherParams.label_show
	                }
	            },
	            itemStyle: {
	                emphasis: {
	                    shadowBlur: 10,
	                    shadowColor: 'rgba(0, 0, 0, 0.5)'
	                }
	            }
	        }]
	    };
	    myCharts.setOption(option);
	}
